import React, {Component } from 'react';
import Swiper from 'swiper';

import 'swiper/css/swiper.min.css';
import './stylesheets/swiper.css';
import styles from './stylesheets/HomePage.module.css';

import actionedited from './images/homePage Slider Images/actionedited.jpg';
import children from './images/childrenimage.jpg';

import hindi from './images/homePage Slider Images/hindi.jpg';
import Slideshow from "./slider";
import AllMovies from "./AllMovies";

class HomePage extends Component {
    componentDidMount() {
        console.log(this.props);
        var swiper = new Swiper('.swiper-container', {
            slidesPerView: 6,
            spaceBetween: 30,
            slidesPerGroup: 6,
            loop: true,
            loopFillGroupWithBlank: true,
            pagination: {
              el: '.swiper-pagination',
              clickable: true,
            },
            navigation: {
              nextEl: '.swiper-button-next',
              prevEl: '.swiper-button-prev',
            },
          });
    }
    render() {
        return (
            <div className={styles.HomePage}>
                <Slideshow className={styles.slider}/>

                {/* <div className={styles.movieslist}>
                    <h2>Movies :</h2>
                </div>
                <AllMovies /> */}

                <div class="swiper-container">
                    <div class="swiper-wrapper">
                        <div class="swiper-slide">
                            <img src={actionedited} />
                        </div>
                        <div class="swiper-slide">
                        </div>
                        <div class="swiper-slide">
                        </div>
                        <div class="swiper-slide">
                        </div>
                    </div>
                    <div class="swiper-button-next"></div>
                </div>

            </div>
           )
        }
}

export default HomePage;
